  true,\n\t\"url\": null,\n\t\"notes\": \"<p>This list includes products subject to
  recall since September 2010 related to infant formula distributed by Abbott. This
  list will be updated with publicly available information as received. The information
  is current as of the date indicated. If we learn that any information is not accurate,
  we will revise the list as soon as possible. When available, this database also
  includes photos of recalled products that have been voluntarily submitted by recalling
  firms to the FDA to assist the public in identifying those products that are subject
  to recall.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
